import "./styles/App.css";
import Daily from "./pages/Daily";
import Navbar from "./components/Navbar";

function App() {
  return (
    <main className="App">
      <section className="App-content">
        <Navbar />
        <Daily />
      </section>
    </main>
  );
}

export default App;
